import React from "react";
import "./style.css";

const hamburgerMenu = ({checkingStatus, settingStatus}) => {


    return (
        <nav>
            <div className="burgerMenu-Container" onClick={() => settingStatus(checkingStatus === "open" ? "close" : "open")}>
                <i className={checkingStatus}></i>
                <i className={checkingStatus}></i>
                <i className={checkingStatus}></i>
            </div>
        </nav>
    )
};

export default hamburgerMenu;
